Describe the purpose of propositional logic in your own words without referring to the textbook.

### Answer:
Despite its name, propositional logic is neither limited to propositions (statements) or the study of logic. Instead, it is an algebraic approach to the study of formal structures and rules. It can be viewed as a study of the reason and methods of thought. This field contributes to mathematics, the field of logic, and even philosophy. 

It can be broadly defined as a formal mathematical system designed to demonstrate and explain the rules of logical inference. But it can also be understood as a framework for providing an axiomatic basis to the deductive discipline of logic. A precise understanding of what it means to make an inference is fundamental to defining what a proof is and why logic is important in mathematics. Its goal is to provide us with a rigorous and secure framework that structures our thoughts and proofs. 

The principles of deductive reasoning from propositional logic:

1. Can make an inference to the truth of a proposition from the assumptions or premises we have made.
2. Can make an inference to the truth of a proposition from the deduction rules.
3. The logical implication of all modal propositions can be represented and manipulated by using a logical connective called implication.

The primary goal of propositional logic as a field is to enable reasoning about propositional expressions for valid inferences. To enable a proposition to contain a variable, we can substitute the truth value of that variable with an expression that behaves similarly. 

This abstract formalization makes it possible to conceive of rational processes in a mechanically repeatable fashion. The exact and predictable way in which reasoning can lead to a logical conclusion enhances our understanding of true and false statements. 

Propositional logic can relate concepts of incomplete understanding, propositions where one predicate (say, the predicate "is a student" referring to a proposition involved in the formation of a CSP) is not fully understood or rejected in one way or another or even if the proposition itself is contradictory. 

We call such incomplete propositions a conjunctive proposition. An object is a CSP (conjunctive propositional formulation), i.e., a set of conditionally clauses where each clauses does not contain any propositional connective, if it is a conjunction of conjunctive propositions. Chirurgical propositions result from the conjunction of possibly assigned but constant or under discussion propositional expressions. 

With the exception of the universal quantifier, every true statement has to assume that its predicate represents a certain subset of its subject independent of the actual witness for that statement. In most cases, we only use this relation between major and subordinate sub-propositions indirectly through axiomatically derived rules of inference. 

The process of using logical implications in moral decision making is very intricate and nuanced. Propositional logic, a science that focuses on predicate largely on the principles of Proposition Logic, helps train our reasoning for 'right' and 'wrong'. By examining every point of inconsistence or contradiction, irrespective of the method used to construct a proposition, one could begin to discern the 'moral' of an unsuccessful proposition. By way of extension, this process can be used either to simply explain the 'moral' of the statement or proposition, or more importantly apply it to determine which alternative is right given what is knowable and available. 

Propositional logic is thus fundamental in artificial intelligence. It stands as the foundation of database search and situation analysis. As a tool in computer logics, computer logics allows a computer to understand the flow of a command based on its meaning, the implications of circumstances change and to make necessary replacements. It is used to analyse messy, tangled, and complicated natural language sentences from a rational and mathematical perspective. The first formal proposal of building an AI was made in the early 1950s.~~~~turnkey project
